  \"2016-04-23T02:37:29.212160\",\n\t\"name\": \"transstats-hcl20062010\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The HCL20062010 dataset contains High Crash
  Locations (HCLs) for intersections and sections for data years 2006-2010. The HCLs
  in this dataset are based on the number of crashes and not the severity of the crashes.
  The intersections and sections analyzed in this dataset are limited to those highways
  that fall under the Federal Aid Highway system. A good overview of of the 2006-2010
  HCL data is available in this PDF http://vtransplanning.vermont.gov/sites/aot_policy/files/documents/highwayresearch/2006-2010_High_Crash_Location_Report.pdf\",\n\t\"license_title\":
